def assertEqual(x: Any, eq: Any):
    print(f'{x}{("==" if x == eq else "!=")}{eq}')

class ListNode(object):
    def __init__(self, val):
        self.val = val
        self.next = None

    @classmethod
    def fromarray(cls, arr):
        p = dummy = cls(None)
        for val in arr:
            p.next = cls(val)
            p = p.next
        return dummy.next

    def __repr__(self):
        return '{}->{}'.format(self.val, self.next)

class TreeNode(object):
    def __init__(self, x):
        self.val = x
        self.left = None
        self.right = None
    def __repr__(self):
        return f'[val:{self.val}, left:{(self.left.val if self.left else None)}, right:{(self.right.val if self.right else None)}]'

    @classmethod
    def fromarray(cls, arr):
        nodes: List[Optional[TreeNode]] = [TreeNode(v) if v is not None else None for v in arr]
        n = len(arr)
        k = 1
        for i in range(n):
            if nodes[i] is None:
                continue
            if k >= n:
                break
            nodes[i].left = nodes[k]
            k += 1
            if k >= n:
                break
            nodes[i].right = nodes[k]
            k += 1
        return nodes[0]

class Solution:
    def isSubPath(self, head: ListNode, root: TreeNode) -> bool:
        n, p = 0, head
        while p:
            n += 1
            p = p.next
        def height(node):
            if node is None:
                return 0
            node.height = 1 + max(height(node.left), height(node.right))
            return node.height
        height(root)
        def matchSubPath(head, root, n):
            if n == 0:
                return True
            if root is None or root.height < n:
                return False
            return head.val == root.val and (matchSubPath(head.next, root.left, n - 1) or matchSubPath(head.next, root.right, n - 1))
        def isSubPath(head, root, n):
            if n == 0:
                return True
            if root is None or root.height < n:
                return False
            return matchSubPath(head, root, n) or isSubPath(head, root.left, n) or isSubPath(head, root.right, n)
        return isSubPath(head, root, n)


